// ColorOverview.js
import React from 'react';
import { Box, Text } from '@chakra-ui/react';

const ColorOverview = ({ themeColors }) => {
  return (
    <Box>
      {Object.keys(themeColors).map((colorName) => (
        <Box key={colorName} display="flex" alignItems="center" mb={2}>
          <Box w="30px" h="30px" mr={2} bg={themeColors[colorName]} borderRadius="md" border="1px solid #ccc" />
          <Text>{colorName}</Text>
          <Text ml={2}>{themeColors[colorName]}</Text>
        </Box>
      ))}
    </Box>
  );
};

export default ColorOverview;
